import React, {useState,Fragment} from 'react';
import styled from 'styled-components';
import Jake from '../images/jake.jpg'
import Card from './Card.jsx' 
import Dark from '../images/dark.png'
import Addicts from '../images/test.webp'
import Wolf from '../images/wolf.png'
import Drip from '../images/test2.webp'

const Container = styled.div`
background-attachment:fixed;
padding:0px;
background-image:url(${Jake});
background-size:100% 100%;
background-repeat:no-repeat;
@media(max-width:768px){
  background-size:cover;
  background-repeat:no-repeat;      
  }
`

const Heading = styled.h2`
text-align:center;
color:white;
padding-bottom: 7%;
padding-top: 9%;
margin:0px;
`

const Flexed = styled.div`
display:flex;
flex-direction:row;
justify-content: center;
margin: 0 auto;
width: 100%;
@media(max-width:425px){
    flex-direction:column;
    justify-content: center;
    margin:0 auto;
}
`

const Overlay = styled.div`
background-color:#1716168c;
position:relative;
margin-top:0%;
left:0%;
top:-0px;
width:100%;
padding-bottom:4%;
@media (max-width:425px){
  height:100vh;
}
`

function Parallax() {

  const [State] = useState([
    {name:"Drip", message:"aasdasd", img:Drip, Link:"https://eloquent-morse-9094ed.netlify.com", alt:"image"},
    {name:"Wolfpack", message:"aasdasd", img:Wolf, Link:"https://wolfpackmedia.netlify.com/",alt:"image"},
  ]);

  const [State2] = useState([
    {name:"Rottweiler Addicts", message:"aasdasd", img:Addicts, Link:"https://rottweiler.netlify.com/",alt:"image"},
    {name:"#Black", message:"aasdasd", img:Dark, Link:"https://dark4.netlify.com/",alt:"image"},    
  ]);

return(
   <div className="row">
        <Container  id="Skills">
            <Overlay>
            <Heading>Projects</Heading>
            <Flexed>
            <Fragment>
            {State.map((data, index) => (
            <Card key={index} name={data.name} message={data.message} img={data.img} Link={data.Link}  alt={data.alt}/>))}
           </Fragment>
           </Flexed>
           <Flexed>
            <Fragment>
            {State2.map((data, index) => (
            <Card key={index} name={data.name} message={data.message} img={data.img} Link={data.Link} alt={data.alt}/>))}
           </Fragment>
           </Flexed>  
            </Overlay>
        </Container>
        </div>
  );
}

export default Parallax;
